import React, { Component } from 'react'
import { withOktaAuth } from '@okta/okta-react'
import { Link } from 'react-router-dom';


function MPOList({ mos, showDialog, setToDone }) {
    return (
        <div className='content'>
            <div className='w3-container' style={{ margin: "200px" }}>
                <div class="w3-responsive">
                    <table class="w3-table w3-striped w3-bordered w3-xlarge">
                        <tr className='w3-green'>
                            <th>
                                ID
                            </th>
                            <th>
                                Status
                            </th>
                            <th></th>
                            <th></th>
                        </tr>
                        {mos.map((product, index) => {
                            const linkVisibility = product.isDone ? { "display": "none" } : { "display": "block" }
                            const isDone = product.isDone ? "Done" : "pending"
                            const compo = Object.keys(product.components)
                            const num = Object.values(product.components)
                            return (
                                <div>
                                    <tr>
                                        <th>
                                            {product.id}
                                        </th>
                                        <th>
                                            {product.date}
                                        </th>

                                        <th>
                                            {isDone}
                                        </th>
                                        <th>
                                            <button key={product.id} onClick={() => setToDone(product.id)} className='w3-button w3-card w3-green' style={linkVisibility}>Set To Done </button>

                                            <button key={product.id} className='w3-button w3-card w3-red' onClick={() => showDialog(product.id)}>Delete</button>
                                        </th>
                                        <th></th>
                                    </tr>
                                    <tr>
                                        {product.components.map(comp => {
                                            return (
                                                <th>
                                                    {comp}
                                                </th>
                                            )
                                        })
                                        }

                                    </tr>
                                </div>
                            )
                        }
                        )}
                    </table>
                </div>
            </div>
            <Link exact to={'/add-product'} className="w3-button w3-black w3-xlarge w3-padding w3-right" style={{ margin: "100px" }}>New Manafacturing Order</Link>
        </div>
    );
}


export default MPOList
